define("bundles/ondemand/components/howStuffWorks/copy/genericInfoCml",["require","exports","module","i18n!nls/ondemand"],function(require,exports,module){var e=require("i18n!nls/ondemand");module.exports=function(){return"<co-content>\n    <text>\n      <strong>"+e("1. How do I pass the course?")+"</strong>\n    </text>\n    <text>\n      "+e("To earn your Course Certificate, youll need to earn a passing\n        grade on each of the required assignmentsthese can be quizzes,\n        peer-graded assignments, or programming assignments. Videos, readings,\n        and practice exercises are there to help you prepare for the graded\n        assignments. ")+"\n    </text>\n\n    <text>\n      <strong>"+e("2. What do start dates and end dates mean?")+"</strong>\n    </text>\n    <text>\n      "+e("Most courses have sessions that run multiple times a year  each\n        with a specific start and end date. Once you enroll for a Certificate,\n        youll have access to all videos, readings, quizzes, and programming\n        assignments (if applicable). Peer-graded assignments can only be\n        submitted and reviewed once your session has begun.  If you choose to\n        explore the course without purchasing, you may not be able to access\n        certain assignments.  If you dont finish all graded assignments before\n        the end of the session, you can enroll in the next session. Your\n        progress will be saved and youll be able to pick up where you left off\n        when the next session begins.")+"\n    </text>\n\n    <text>\n      <strong>"+e("3. What are due dates? Is there a penalty for submitting my\n        work after a due date?")+"</strong>\n    </text>\n    <text>\n      "+e("Within each session there are suggested due dates to help you\n        manage your schedule and keep coursework from piling up. Quizzes and\n        programming assignments can be submitted late without consequence.\n        However, it is possible that you won't receive a grade if you submit\n        your peer-graded assignment too late because classmates usually review\n        assignment within three days of the assignment deadline.")+"\n    </text>\n\n    <text>\n      <strong>"+e("4. Can I re-attempt an assignment?")+"</strong>\n    </text>\n    <text>\n      "+e("Yes. If you want to improve your grade, you can always try again.\n        If youre re-attempting a peer-graded assignment, re-submit your work\n        as soon as you can to make sure theres enough time for your classmates\n        to review your work. In some cases you may need to wait before\n        re-submitting a programming assignment or quiz. We encourage you to\n        review course material during this delay.")+"\n    </text>    \n  </co-content>"}});
define("bundles/ondemand/components/howStuffWorks/copy/peerReviewAssignmentInfoCml",["require","exports","module","i18n!nls/ondemand"],function(require,exports,module){var e=require("i18n!nls/ondemand");module.exports=function(){return"<co-content>\n  <text>\n    "+e("Peer-graded assignments require you and your classmates to\n      grade each others work.")+"\n  </text>\n\n  <text>\n    <strong>"+e("1. How do peer graded assignments work?")+"</strong>\n  </text>\n  <text>\n    "+e("After you submit your work, youll be asked to review your classmates assignments.\n    To pass, youll need to earn a passing grade on your submission and complete the\n    required number of reviews.")+"\n  </text>\n\n  <text>\n    <strong>"+e("2. How are grades calculated?")+"</strong>\n  </text>\n  <text>\n    "+e("You and your classmates will be asked to provide a score for each part of\n    the assignment. Final grades are calculated by combining the median scores you\n    received for each section.")+"\n  </text>\n\n  <text>\n    <strong>"+e("3. What kind of feedback should I give?")+"</strong>\n  </text>\n  <text>\n    "+e("Be respectful, encouraging, and honest. Acknowledge what your classmate\n    did well and offer specific suggestions on how they can improve. Scores should\n    reflect the learners understanding of the assignment prompt and points should\n    not be deducted for difficulties with language or differences in opinion.")+"\n  </text>\n\n  <text>\n    <strong>"+e("4. Is there a penalty for submitting my work late?")+"</strong>\n  </text>\n  <text>\n    "+e("No, but its important to submit your work as close to the due date as you can.\n    Classmates grade most of the assignments within three days of the due date.\n    If you submit yours too late, there may not be anyone to review your work.")+"\n  </text>\n\n  <text>\n    <strong>"+e("5. If I fail an assignment, can I try again?")+"</strong>\n  </text>\n  <text>\n    "+e("Yes! Youll can always try again, but youll need to resubmit your work as\n    soon as possible to make sure your classmates have enough time to grade your work.")+"\n  </text>\n\n  <text>\n    <strong>"+e("6. Can I edit my assignment?")+"</strong>\n  </text>\n  <text>\n    "+e("Yes, but youll need to re-submit your work and any grade youve already\n    received will be deleted.")+"\n  </text>\n</co-content>"}});
define("bundles/ondemand/components/howStuffWorks/copy/programmingAssignmentInfoCml",["require","exports","module","i18n!nls/ondemand"],function(require,exports,module){var n=require("i18n!nls/ondemand");module.exports=function(){return"<co-content>\n    <text>\n      <strong>\n        "+n("Programming assignments require you to write and run\n        a computer program to solve a problem.")+"\n      </strong>\n    </text>\n\n    <text>\n      <strong>"+n("1. What are programming assignments?")+"</strong>\n    </text>\n    <text>\n      "+n("Programming assignments include both assignment instructions and assignment parts.\n      Instructions may include a link to a downloadable starter package that includes\n      starter code, detailed guidelines, and other resources. Assignment parts are similar\n      to individual quiz questions. Each part is a single coding task that can be\n      completed one at a time.")+"\n    </text>\n\n    <text>\n      <strong>"+n("2. How are programming assignments graded?")+"</strong>\n    </text>\n    <text>\n      "+n("Programming assignments are graded automatically. If they use a built-in-algorithm\n      youll see your grade within seconds. If they use a custom grader,\n      you may need to wait up to an hour.")+"\n    </text>\n\n    <text>\n      <strong>"+n("3. Can I resubmit a programming assignment?")+"</strong>\n    </text>\n    <text>\n      "+n("You can resubmit all programming assignments to improve your grade.\n      Follow the same steps as submitting a new assignment.")+"\n    </text>\n\n    <text>\n      <strong>"+n("4. What do I do if I have trouble submitting my assignment?")+"</strong>\n    </text>\n    <text>\n      "+n("If you have trouble submitting your assignment, we encourage you to\n      visit your course Discussion Forums as many of your peers are likely to have\n      had similar problems and have found a solution. Each programming assignment\n      has its own sub-forum to discuss with peers.")+"\n    </text>\n  </co-content>"}});
